import java.io.*;
import java.util.*;
import com.eviware.soapui.impl.support.http.HttpRequestTestStep

def rawRequest = new String(messageExchange.getRawRequestData(), "UTF-8")
def rawrequest1 = rawRequest.indexOf("GET")+4;
def rawrequest2 = rawRequest.indexOf("HTTP")
def url = rawRequest.substring(rawrequest1,rawrequest2)

messageExchange.modelItem.testStep.setPropertyValue("Request", url)

con:config.script:
def env = testRunner.testCase.testSuite.project.activeEnvironment.name
log.info ("Environment In Use >> " +env)

def brand = context.expand('${DataSource#brand}');

if (brand == "C" || brand == "c"){
	//log.info ("ccc")	
	def CELEB_A_LOGIN_USER_NAME = context.expand( '${Properties_ProfileIDs#CELEB_A_LOGIN_USER_NAME}' )	
	//log.info (CELEB_A_LOGIN_USER_NAME);
	testRunner.testCase.setPropertyValue("profileID",CELEB_A_LOGIN_USER_NAME);

}else if (brand == "R" || brand == "r"){
	//log.info ("rrrr")
	def ROYAL_A_LOGIN_USER_NAME = context.expand( '${Properties_ProfileIDs#ROYAL_A_LOGIN_USER_NAME}' )	
	//log.info (ROYAL_A_LOGIN_USER_NAME);
	testRunner.testCase.setPropertyValue("profileID",ROYAL_A_LOGIN_USER_NAME);

} else {
	log.info ("INVALID BRAND ID")
}

